import Container from 'react-bootstrap/Container'
import Col from 'react-bootstrap/Col'
import Row from 'react-bootstrap/Row'
var React = require('react');

class Prueba extends React.Component{
    constructor(props){
        super(props);
    }
    
     
    render(){
    
        return(
            <Container>
                <Row>
                    <Col>hola </Col>
                    <Col>chao</Col>
                </Row>
            </Container>

            
      
                        );
    }
};

export default Prueba;
